import { motion, useAnimationControls } from "framer-motion"
import estyle from "./Rectangle.module.scss"
import { useEffect } from "react"

function Rectangle({props}) {

    useEffect(() => {

        const sequence = async () => {
            await divControls.start('start')
            divControls.start('start2')
        }

        sequence()
    })


    const svgVariants = {
        ready: { opacity: 0},
        start: { opacity: 1,
            transition: { 
                opacity: { delay: 3, duration: 1, type:'tween', ease:'easeIn' }

            }
        }
    }

    const rectangleAnim = {
        ready: { y:0, x: 50, width:0 },
        start: { x: 5, width:50,
            transition: { 
                x: { delay: 3.5, duration: 1, type:'tween', ease:'easeInOut' },
                width: { delay: 3.5, duration: 1, type:'tween', ease:'easeInOut' }
            }    
        },
        start2: { x: 0, width:12,
            transition: { 
                x: { delay: 0, duration: 1, type:'tween', ease:'easeInOut' },
                width: { delay: 0, duration: 1, type:'tween', ease:'easeInOut' }
            }    
        }
    }

    const divControls = useAnimationControls();

    return (
        <div >
            <motion.svg className={estyle.thesvg} width="12" height="4" fill="none" xmlns="http://www.w3.org/2000/svg"
                variants={rectangleAnim}
                initial="ready"
                animate={divControls}
            >
